          centered
        >
          {MENU.map(menu => (
            <Tab label={menu.name} href={menu.href} key={menu.id} />
          ))}
        </Tabs> */}
        <IconButton color="inherit"></IconButton>
        <Drawer>
          <MenuItem>Home</MenuItem>
        </Drawer>
      </AppBar>
    </div>
  );
}

export default Header;
